import React from 'react';
import { Section, Container, ColumnLeft, ColumnRight} from './InfoSectionElements';
import {Button} from '../Button/ButtonElements';

const InfoSection = ({heading, paragraphOne, paragraphTwo, buttonLabel, reverse, image, delay}) => {
    return (
       <Section>
           <Container>
               <ColumnLeft reverse={reverse}
                data-aos='fade-up'
                data-aos-duration='1000'
                data-aos-once='true'
                data-aos-delay={delay}
               >
                    <h1>{heading}</h1>
                    <p>{paragraphOne}</p>
                    <p>{paragraphTwo}</p>
                    <Button to='/home' primary='true'>{buttonLabel}</Button>
               </ColumnLeft>
               <ColumnRight reverse={reverse}>
                <img src={image} alt='home' />
               </ColumnRight>
           </Container>
       </Section>
    );
};

export default InfoSection;
